The "M" modifier keys are a platform-independent way of representing keys:
 - M1 is the COMMAND key on MacOS X, and the CTRL key on other platforms;
 - M2 is the SHIFT key;
 - M3 is the Option key on MacOS X, and the ALT key on other platforms;
 - M4 is the CTRL key on MacOS X, and is undefined on other platforms.

Die "M" Modifikatortasten sind eine plattformunabhängige Art Tasten zu belegen:
 - M1 ist die Befehlstaste bei MacOS X, und die STRG-Taste auf anderen Plattformen;
 - M2 ist die SHIFT-Taste;
 - M3 ist die Optionstaste bei MacOS X, und die ALT-Taste auf anderen Plattformen;
 - M4 ist die STRG-Taste bei MacOS X, und ist auf anderen Plattformen undefiniert.

Les touches de modificateur "M" sont des méthodes de représentation des touches indépendantes de la plate-forme:
 - M1 est la touche COMMAND pour MacOS X et CTRL pour les autres plate-formes ;
 - M2 est la touche MAJ ;
 - M3 est la touche Option pour sur MacOS X et ALT pour les autres plates-formes ;
 - M4 est la touche CTRL pour MacOS X et est indéfinie pour les autres plates-formes.

De "M"-wijzigingstoetsen zijn een platform-onafhankelijke manier om toetsen weer te geven:
 - M1 is de COMMAND-toets in Mac OS X en de CTRL-toets in andere platforms;
 - M2 is de SHIFT-toets;
 - M3 is de Option-toets in Mac OS X en de ALT-toets in andere platforms;
 - M4 is de CTRL-toets in Mac OS X en is niet gedefinieerd voor andere platforms.

“M”修饰符键是一种独立于平台的表示键的方式：“-M1是MacOS X上的命令键，而在其他平台上是CTRL键;
-M2是SHIFT键;
-M3是MacOS X上的选项键，而在其他平台上是ALT键;
-M4是MacOS X上的CTRL键，并且在其他平台上未定义。

