現在編集しているファイルに対するNVDLスキーマの検証に使用されるコマンドライン引数。 引数には 任意のカスタムスイッチ(たとえば -sch) と、現在のファイルパスが挿入される
            ${cf} および Schematronスキーマファイルパスが挿入される ${ds} の２つのエディタ変数を含めることができます。 例えば ${cf} --sch ${ds}
            は、現在編集しているファイルに対して与えられたスキーマを検証します。 エディタ変数は、検出された参照によって実行時に置換されます。

